column3:
You’re a Pokémon Trainer! I happen to be a
{pageend:Pokémon Trainer!}
Our eyes met, so battle we must!

{pageend:I’m always with my Pokémon.}
Actually, you’re always with your Pokémon too,
aren’t you?

I got a nifty-keen Gym Badge from the Gym
{pageend:Leader in Oreburgh City!}
...Did I show you already?

{pageend:Who gave you your first Pokémon?}
Your first Pokémon is the one with the most
fond memories, I think.

Bug Pokémon grow quickly, and they do stuff like
{pageend:poison and paralyze, and they’re cute and cool.}
You gotta believe me—they’re good!

They say there are rough Pokémon in
{pageend:Eterna Forest.}
I’d better be more prepared than this.

{pageend:What can I tell you about Pokémon?}
Well, there are males and females. And some
that you can’t tell.

If you meet someone in the mountains, they’re
{pageend:no longer strangers.}
Meet them twice—they’re your friend!

{pageend:!}
Yank your fishing rod when that appears.
That’s how you fish.

{pageend:There you are!}
I’ve been riding in this spot so I’d get a rematch
with you!

Let me see if you’ve learned how to ride your
{pageend:bike properly...}
in battle!

{pageend:You and I, we’re both riding bikes.}
And you’ve got Pokémon. I don’t want to lose
to you!

{pageend:I want to practice repairing flat tires...}
But I’ve been practicing with my Pokémon to get
our revenge!

Some people compete over speed, and some
{pageend:compete over technique.}
Which kind are you?

{pageend:I enjoy the scenery.}
Don’t you think the area below Cycling Road
looks nice?

{pageend:Wahaha!}
Laughter brings good fortune! Forgetting your
gloves brings a cold!

{pageend:Wow, you’re sure impressive!}
I guess it makes no difference if you’re young or
old in Pokémon battles.

I, uh, chowed down my packed lunch before we
{pageend:started climbing.}
If I beat you this time, share some food with me!

{pageend:Oh, you want to have a battle?}
I was meaning to enter a Super Contest Show,
but beating you won’t take long.

{pageend:You and your Pokémon have so much energy.}
I think you would do well in Super Contest
Shows, too.

{pageend:Oh, didn’t we meet before?}
I was meaning to enter a Super Contest Show,
but let’s have a quick battle first.

{pageend:You and I!}
Let us create a scene—a fantastic tableau
of battle!

That battle will surely become a stupendous
{pageend:masterpiece painting!}
{pageend:I shall title it...}
“Pokémon Can Win!”

{pageend:When I go on my jogs, I pass by lots of people.}
I have trouble remembering faces, but we did
meet before, right?

{pageend:Hi, hi! I’m a Pokémon!}
I think you already know, but we’re going to
battle again!

When I was jogging the other day, a wild
{pageend:Pokémon came after me.}
I ran so fast, I was on top of the waves, I swear.

My Pokémon toughened up from working on
{pageend:the ranch.}
I’m right proud of them!

I’ve been training so I can have a rematch
{pageend:with you.}
I’m OK to battle!

{pageend:Oh, hi! It’s good y’all came calling on us again!}
I can take a break from work if I’m battling
Pokémon. Lucky for me!

{pageend:My cover is blown, so what should I do?}
Maybe I’ll go catch some Super Contest Shows
in Hearthome City. Maybe I’ll do that.

You should join us so we can form the
{pageend:Ninja Quartet!}
Anyway, let’s battle!

{pageend:As an Ace Trainer, I have to take battles in stride.}
I need to stay cool and calm whether I win
or lose.

The power of youth and the technique of
{pageend:the Veteran...}
Let us battle again to see which shall prevail!

{pageend:I just startled you!}
While you’re still struggling to recover, I’ll
already be the winner!

There’s a ninja Gym Leader somewhere
{pageend:far away.}
I should become a devotee of theirs.

{pageend:My bird Pokémon has such gorgeous wings.}
It must have been some sort of a mistake that we
lost last time!

Sowing confusion among foes is one way a
{pageend:ninja battles.}
A confused Pokémon can’t show its full power!

{pageend:Oh, my poor little battler is all tuckered out...}
I’ll let it sleep in that bed I had sent
from overseas.

{pageend:Oh, it’s you again, dear?}
It makes me a little nervous, but may I have
a rematch?

{pageend:Why, hello there!}
It’s always nice when a Trainer stops and says hi
to us police officers!

{pageend:Heya, long time!}
Are you enjoying your nature-filled adventure
with Pokémon?

{pageend:Oh, what have we here? That’s a Pokédex!}
It records Pokémon data upon sight? I’ve never
{pageend:seen one before!}
I heard you can move the sun or moon icon to
check the Pokémon habitat map by time of day!

I take down details in my notebook about
{pageend:Pokémon I’ve battled.}
I’ll write more data down about your Pokémon!

I want to show off my pretty parasol, but it will
{pageend:get dirty in the rain.}
Oh, such a big dilemma!

When I see people surfing, I don’t feel jealous
{pageend:or anything.}
I just simply love to swim!

{pageend:Ah-ha! I found me a Trainer!}
I challenge you to battle with the Pokémon
I’ve found!

I’ve been traveling around the world chasing
{pageend:stories on mysteries.}
It’s made me pretty tough!

There are mysteries waiting for me to investigate
{pageend:around the world.}
This is no time to be feeling sorry for myself.

For the sake of my collection, I take on people I
{pageend:know I can’t beat.}
That’s what a collector does.

For the sake of my collection, I keep battling
{pageend:people I can’t beat.}
That’s what a collector does.

I’ll battle against people who’ve beaten me
{pageend:again and again.}
By doing that, we both grow a little as Trainers.

{pageend:Oh, it’s you again!}
I’ve regained my confidence. Let’s have
another battle!

{pageend:A real ace doesn’t get hung up on getting wins.}
A real ace sets sights consistently higher to
improve themselves.

To be ready to answer any call! To be ready to
{pageend:accept any challenge!}
That is the way of a Trainer!

{pageend:Rainy days make me feel blue...}
But the instant it starts to snow, I’m as happy as
can be!

{pageend:Outdoor fishing for the win!}
Shouting doesn’t help my fishing any, but shout
I must!

Yo! You’re that Trainer who taught me how fun
{pageend:Pokémon can be.}
Let’s have another battle, you and me!

{pageend:People consider me an Ace Trainer.}
Let me demonstrate the skills that earned me
that title!

{pageend:You’re going to Renegade Park?}
It’s not right that you get to go before a
collector like me!

{pageend:Once I hook it, no fish gets away from me!}
A Trainer walking by also can’t get free of
my clutches!

Yo! I remember how our battle was a good
{pageend:change of pace before.}
Let’s have another quick battle!

It takes both brains and brawn when you’re out
{pageend:at sea.}
Aye, it’s not an easy job, the sailor’s life!

I only seem to run into you after I go to
{pageend:the restaurant.}
Etiquette calls for a battle after a meal. Shall we?

Don’t get careless, even if you’re facing
{pageend:someone familiar.}
Do your deep-breathing exercises...

{pageend:I’d better get on back to work...}
You know, I’d rather be traveling around with
Pokémon the way you do.

{pageend:Ewww, nasty! This forest is full of bug Pokémon...}
I also forgot to buy some Antidotes. It’s just the
worst thing ever!

The Old Chateau...lies abandoned, with none
{pageend:living in its walls...}
And yet, and yet, there permeates a presence...

One day, people will run to the other side of the
{pageend:road when I walk by ’em.}
It’s a goal of mine I’m working on.

{pageend:If you don’t give up, you can reach your goal.}
That perseverance is what’s important to Trainers.
That’s in my book, too.

It doesn’t appear as if anyone could even try to
{pageend:stand against your might.}
The Elite Four should just surrender.

I can sense that your Pokémon have a lot of trust
{pageend:in you.}
You and your Pokémon... You seem to be aglow.

{pageend:The wings of freedom...}
I know I’ll find them if I can win my way through
the Pokémon League...

In the Pokémon League ahead, the Elite Four
{pageend:await you!}
But you knew that already.

{pageend:Yup, the way you battle is fantastic!}
You should try to take on the Elite Four right
now—not later!

{pageend:We want to have a battle without an advantage.}
Please come back when you have at least
two Pokémon!

{pageend:You have but one Pokémon?}
I would say that you are taking Victory Road too
lightly, kid.

I get to work all day with my Pokémon—and even
{pageend:battle sometimes.}
I get all the fun I need every day!

{pageend:Steel represents an unbending spirit!}
If you never give up, the path to victory
reveals itself!

Pokémon and people have worked together for
{pageend:many years.}
Let us show you an example of that history!

I’m a collector, and I’m proud of what I know
{pageend:about Pokémon.}
Would you like me to test your knowledge?

My Grass-type Pokémon can dole out some
{pageend:serious special attacks.}
I won’t let you win easily!

{pageend:Oh, that’s right... A hint about the next Trainer...}
In the middle of three trees. That’s it for my hint.
Good luck!

{pageend:Hunwah! It’s gone and ended!}
How will I say this... I want more! I wanted to
battle a lot more!

My body isn’t the only thing I work on
{pageend:toughening up here.}
I also work on my Pokémon and my spirit!

{pageend:We’re the Karate Quads!}
I will strike a blow for love with my fist!
Hiyah, looooooooove!

{pageend:Your Pokémon sure are tough!}
But our Gym Leader Maylene will break you like
a stack of bricks!

{pageend:We’re the Karate Quads!}
I will strike a blow for courage with my fist!
Hiyah, couraaaaaaaaaaage!

{pageend:We’re the Karate Quads!}
I will strike a blow for hope with my fist!
Hiyah, hoooooooooooooope!

{pageend:We’re the Karate Quads!}
I will strike a blow for tears with my fist!
Hiyah, teeeeeeaaaaaaaaars!

{pageend:I lost because I didn’t eat enough pizza.}
No. Anything I say will sound like I’m
making excuses.

You won because of Pokémon type matchups,
{pageend:cool tactics...}
You know, all sorts of reasons!

{pageend:Are you feeling the chill of fatigue?}
A good Trainer goes for the win no matter what
their condition is!

{pageend:Spark!}
This is what our Gym Leader did to the Gym out
of boredom!

{pageend:We were lacking energy...}
No, we lacked more than that. We didn’t want
the win enough.

The way you battle, I can feel the very heart of
{pageend:rock and roll.}
Tell me—are you maybe a fan of rocking out?

I dress this way so I can learn to think like an
{pageend:Electric-type Pokémon.}
Why don’t you give it a try?

{pageend:This is the toughest Gym in Sinnoh.}
That’s why I’m here—to learn the best battle
techniques around!

{pageend:I had a lot of fun battling with you, though.}
I wonder if I can analyze the battle
{pageend:data properly.}
I could use a rematch to get some
additional data.

For some reason I was drawn here, and it is here
{pageend:that I met you...}
I want to know what all this means!

There is nothing here... And yet there is a
{pageend:power lurking...}
Were you drawn by it as well?

{pageend:A place where nothing else exists...}
A place such as that is better suited to awaken
the power within.

{pageend:I’m still here...and still searching for treasures.}
However, a battle with you is a treasure I can’t
pass up!

{pageend:Ah, it’s been a long time!}
I have been toughening my fists against the sea,
just as before!

{pageend:Wimpy little Pokémon...}
When I get promoted, I’ll demand better
stolen Pokémon.

{pageend:Why, thank you!}
We love it when people come to us to donate
their Pokémon!

Though they are gone, their desire to battle lives
{pageend:on? The spirits of Pokémon still linger?}
Is that what it is?

My Pokémon were taken from me...
{pageend:Team Galactic did it...}
Ever since, I’ve never forgiven their faces...

{pageend:Tough Pokémon... Tough Trainers...}
You tell me—where else can I find a place as
good as this to train?

{pageend:Tough Pokémon... Tough Trainers...}
A strong spirit and a tight bond... There is so
much to train for.

{pageend:So, I’m gonna try and shatter steel!}
I wonder how many more years it would take for
me to do that?

Actually, when you’re up in the mountains,
{pageend:a simple hi’d do if you walk past someone.}
Oh, and this isn’t the mountains.

{pageend:May we have a battle, please?}
It will be something to lighten up this boring
picnic with.

I’m very picky, so I want to collect every
{pageend:Pokémon without anyone’s help.}
...I do have friends, though. No, seriously! I do!

In deep tunnels and caves, there’re a couple
{pageend:things you’re sure to see.}
Zubat and Ruin Maniacs!

Being this tough isn’t good enough. You have to
{pageend:look cool while doing it.}
Mastering that makes you an ace!

I want my Pokémon to get a taste of the
{pageend:sweetness that is victory.}
I can’t afford to lose this one!

{pageend:I feel sorry for my hungry Pokémon...}
Sorry, team. I’ll get tougher so you can feast on
the taste of victory...

{pageend:A battle is a clash of willpower!}
The one who wants the win the most will emerge
the victor!

{pageend:Psychic power...}
It’s hard to put faith in something that you
can’t see...

{pageend:How do I use my psychic powers?}
I never use them for dishonest ends. I also never
do any good deeds...

{pageend:I’ll forget that we lost!}
Wait—if I did that, we’d never learn from
our mistakes...

I don’t ever want to put my Pokémon through
{pageend:that again...}
It got humiliated because I wasn’t good enough...

Dragon Pokémon are sacred beings... That’s what
{pageend:my master taught me.}
And now I’ll prove it to you!

{pageend:Pokémon battles aren’t decided by numbers.}
The decisive factor is the bond you share with
your Pokémon!

I grew up together with my team, right from
{pageend:my childhood.}
All our memories, we’ve always shared them.

There is always something to like about
{pageend:any Pokémon.}
It’s so hard to decide which ones I should raise.

{pageend:I thought I couldn’t win before it became a fact...}
I’ve let down my Pokémon... They go to battle
with faith in their Trainer...

Do you remember my slogan?
{pageend:People! Nature! Pokémon!}
That’s right. Harmony is essential!

{pageend:I work to protect beautiful, natural environments.}
My Pokémon are my constant companions while
I work.

We’ve grown strong together in nature and in the
{pageend:concrete jungle.}
We make everywhere we go our playground!

{pageend:Look around you at this wildly contorted terrain.}
It’s no wonder that Pokémon would grow tough
in a place like this.

I think I’m pretty tough, but so are you and
{pageend:your Pokémon.}
Let’s have a battle to see who is the toughest!

{pageend:What do you think of the Battle Zone?}
You’ve met so many Pokémon... I’ve got to battle
you again!

{pageend:Hi! You’re that kid who’s great with Pokémon!}
I’ll battle with an even more dynamic form than
before! Watch me now!

{pageend:I’m a mermaid who drifts among the waves...}
But I’m also a playful girl who likes to have fun
with Pokémon!

{pageend:I remain a mermaid who drifts among the waves...}
But I’m also a playful girl who likes to have fun
with Pokémon!

{pageend:Our boss always had plans for the three lakes.}
While you were blissfully ignorant, our work
went ahead...

So, you’re tough. Big deal. What do you think
{pageend:you can accomplish?}
There’s one of you up against the entirety of
{pageend:Team Galactic.}
By now, another crew should be on their way to
Lake Verity near that puny little Twinleaf Town!

We’re Team Galactic! The number one syndicate
{pageend:in the world!}
To defy us is to defy the universe!

I played you for a child, and paid a stiff price for
{pageend:my arrogance...}
{pageend:However, you’re much too late.}
Team Galactic has already found the sunken
{pageend:island under the lake—}
And the Pokémon that slumbers there?
Well, where do you think it is now?

{pageend:Losing sets me back to square one...}
I’ll probably get bumped down to the gruntiest
of the grunts... Humph!

It doesn’t matter what happens to the
{pageend:Team Galactic HQ building.}
Soon, all will belong to Team Galactic!

{pageend:What’s so special about you anyway?}
You’re just like any other little kid Trainer
anywhere else!

{pageend:It’s too late!}
No amount of desperation from a kid like you
will make a difference!

{pageend:Our time will come... A time for only us!}
I’m going to turn back your time to a time
before Pokémon!

{pageend:Team Galactic is all-powerful!}
Only a fool would show defiance to the mighty
might of Team Galactic!

{pageend:Mount Coronet...}
I might only be a grunt, but even I can tell it has
a weird energy!

{pageend:Team Galactic will take control of everything!}
You can try all you want, but you can’t do
anything alone!

{pageend:We grunts have been assigned two noble jobs—}
One, to ensure the success of our operation at
{pageend:the summit!}
And two, to utterly destroy anyone who
dares interfere!

{pageend:One person’s joy is another person’s sorrow...}
Everyone should be happy and laughing?
{pageend:How ridiculous!}
Team Galactic should be doing all the laughing!

Our boss is going to do something huge at
{pageend:the summit.}
But here I am dealing with some pesky
{pageend:intruder...}
You’re spoiling the atmosphere. You can lose
quickly, right?

{pageend:All my excitement’s gone now...}
This whole Mount Coronet trip is too rough,
long, and draining...

We couldn’t stop you... We’ll be discarded
{pageend:as useless...}
Our boss is ruthless that way...

{pageend:I will now concede defeat.}
But I think you came to see how great Bug-type
{pageend:Pokémon can be.}
I hope you also realized what you’re up against
{pageend:in the Pokémon League.}
Battling is a deep and complex affair...

Well! Dear child, I must say, that was
{pageend:most impressive.}
Your Pokémon believed in you and did their best
{pageend:to earn you the win.}
Even though I’ve lost, I find myself with this
silly grin!

{pageend:Whoa!}
{pageend:I wasn’t expecting this!}
I wasn’t looking down on you, but I didn’t think
{pageend:for a second that I’d lose!}
This is fantastic! You and your Pokémon
are inspiring!

{pageend:I see...}
You getting past the three before me was
no fluke. Your power is real.

Just a few minutes ago, you were the most
{pageend:powerful challenger.}
And just now, you became the most powerful of
{pageend:all the Trainers.}
You are now our newest Champion!

{pageend:I’m always with my Pokémon.}
Actually, you’re always with your Pokémon too,
aren’t you?

{pageend:I’m always with my Pokémon.}
Actually, you’re always with your Pokémon too,
aren’t you?

{pageend:I’m always with my Pokémon.}
Actually, you’re always with your Pokémon too,
