{pageend:again and again.}
By doing that, we both grow a little as Trainers.

{pageend:Oh, it’s you again!}
I’ve regained my confidence. Let’s have
another battle!

{pageend:Oh, it’s you again!}
I’ve regained my confidence. Let’s have
another battle!

Do you remember my slogan?
{pageend:People! Nature! Pokémon!}
That’s right. Harmony is essential!

We spend all our time battling in the blizzards of
{pageend:Snowpoint City.}
We’ll show you how it’s toughened us up!

{pageend:Our boss is a scientific genius!}
He will make the power of Legendary Pokémon
his own!

{pageend:Hey, now! Our HQ is a state-of-the-art facility!}
A snot-nosed kid like you ought to keep your
dirty hands to yourself!

Our boss is trying to create an entirely
{pageend:new world.}
A world only for us! For Team Galactic!

{pageend:Pika...}
I’ll need a lot more practice to become a
real Pikachu...

Well! It’s not often we get a visitor like you to
{pageend:the ironworks!}
Let’s mark the occasion with a battle!

I won’t accept this! The power spoken of
{pageend:in mythology...}
I didn’t just make it obey me, I made it my own!

I won! I finally defeated {tag:0}{pageend:!}
It was me... I did it... which means... I’m the
greatest Pokémon Trainer in the world!

{pageend:A fierce bout that was!}
I can definitely tell that you’re serious about this.
Come back and try again any time!

{pageend:Unbelievable! What burning passion!}
You’re like the sun to your own solar system,
{tag:0}!
